OH MEIN GOTT, DANKE! ❤️
Du bringst mir gerade den Glauben an die Menschheit zurück... Immer dieses „hey“ oder „hey wie gehts“ &colon;D

Einen passenden Witz habe ich nicht, das ist meistens eher Situationskomik, aber falls dir einer einfällt immer her damit &colon;&rpar;
Du arme... Ich kenne nur wenige, die mit Tieren so garnichts anfangen können &lpar;zum Beispiel mein Mitbewohner - der hat den Hund meiner Eltern mit möglichst weit ausgestreckter Hand “gestreichelt&rdquo; &colon;D&rpar;
Bei mir in der Uni sind da natürlich viele tierfreundliche Menschen &colon;&rpar;

Seit wann bist du denn aus UK zurück? 
Übrigens hast du einen sehr sehr schönen Profiltext! &colon;&rpar;

Schön, dass du das direkt sagst &colon;&rpar;
Ich habe absolut nichts gegen schreiben, das kann bei passenden Gesprächsthemen auch sehr interessant sein, wenn die Konversation nicht direkt mit „hey wie gehts?“ startet &colon;D
Allerdings habe ich hier auch die Erfahrung gemacht, dass die Erwartung doch steigen, wenn man viel schreibt und das auch schnell zur Enttäuschung führen kann, wenn man sich dann letztendlich sieht. Aber ich wäre durchaus bereit dem mal eine Chance zu geben &colon;&rpar;

So dann zu deinem „Quiz“&colon;
A&rpar; ich bin single
B&rpar; da hole ich mal lieber länger aus, damit du auch direkt weißt woran du bist und ob du überhaupt Interesse hast&colon;
Ich finde Frauen anziehend und wollte schon immer mal einer Frau näher kommen &lpar;das ist also nichts, was sich auf einmal in der letzten Woche ergeben hat&rpar;. Ich habe bisher allerdings meine Erfahrungen eher mit Männern gemacht, bin also kein Unschuldslamm, aber bisher ist da mit Frauen wenig passiert, was ich aber gerne ändern würde.

Das nennt man dann vielleicht bicurious &lpar;?&rpar;, ich finds aber schade, dass einfach in eine Schublade zu stecken, deswegen der Text dazu &colon;&rpar;

Es kann natürlich sein, dass sich meine Situation bzw. mein Erfahrungsstand ändert bis du wieder hier bist, aber so sieht das momentan bei mir aus...
Da müsstest du dann wissen, ob es überhaupt dein Interesse weckt &colon;&rpar;

Hey, vielen lieben Dank für das Kompliment! &colon;&rpar;
Ich denke ich bin eine gesunde Mischung aus beidem und kann Feiern gehen genauso wertschätzen wie mal einen entspannten Abend mit guten Freunden. Bin aber insgesamt gerne unterwegs und unternehme viel 😉
Wie sieht denn dein perfektes Wochenende aus? &colon;&rpar;

Vollkommen verständlich, das Feiern schlaucht einen auch bis in den nächsten Tag und dann ist das Wochenende schon quasi gelaufen...
Was kommt dann bei einem Kochabend bei dir auf den Tisch, mal ganz abgesehen von Kinderschoki &lpar;die Riegel schenkt meine Oma mir immer noch zu jeder Gelegenheit 😜&rpar;?

Das klingt für mich nach einem nahezu perfektem Wochenende. &colon;&rpar;

