Mir ist das lieber, das direkt zu sagen, damit du auch schreiben kannst ob du überhaupt auf sowas Lust hast. Vorausgesetzt natürlich man versteht sich auch gut und es passt zusammen. &colon;&rpar;

Wunderbar, ich will ja auch dass es dir gefällt und du weißt was du an mir hast. &colon;&rpar;
